import  React, { Component } from 'react';
import './rfid.style.css';

class rfid extends Component {
  
    render() {
      return (
       
    <div className="row rowsetFeat">

    <section className="container ourservice text-center">
        <h1>RFID SERVICES</h1>

        <p>With our propritary design & implementation of RFID systems, the Retail and Manufacturing industries can benifit
          greantly in terms of <h7>Increased Work Efficiency, sales Boost</h7> and <h7>Improved Customer Service Levels</h7>
        </p>

            
    </section>
          </div>

      );
    }
}

export default rfid;
